INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 321, "リリ", 0, 1, 2, 40011, 1, 125801, 24001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 322, "クリア", 0, 2, 2, 40011, 1, 126001, 24001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("んーと。\nこれ、あげる。\nはい", 1, 323, "プレシア", 0, 3, 2, 40011, 1, 126101, 24001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 324, "リリ", 0, 4, 2, 40011, 2, 125801, 24001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 325, "クリア", 0, 5, 2, 40011, 2, 126001, 24001);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("お兄。\nきてくれて、うれしい", 1, 326, "プレシア", 0, 6, 2, 40011, 2, 126101, 24001);
